import React from "react";

const Users = props => {
  return (
    <div>
      {props.users.map(u => (
        <li key={u.id}>
          <div>
            <span>
              <div>
                <img src="" alt="" />
              </div>
              <div>
                <button>follow</button>
              </div>
            </span>
            <span>
              <span>
                <div>{u.fullName}</div>
                <div>{u.status}</div>
              </span>
              <span>
                <div>{u.location.country}</div>
                <div>{u.location.city}</div>
              </span>
            </span>
          </div>
        </li>
      ))}
    </div>
  );
};

export default Users;
